  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset provides final seasonally
  adjusted employment estimates for the State of Iowa. Iowa's estimate contained in
  this dataset is broken into the following \"expanded\" supersectors:rnrn    Goods-Producing:
  Construction, Manufacturing, and Mining and Loggingrn    Service-Providing: Education
  and Health Services, Financial Activities, Information, Leisure and Hospitality,
  Other Services, Professional and Business Services, Retail Trade, Transportation
  and Utilities, and Wholesale Tradern    Government: Federal Government, State Government,
  and Local GovernmentrnrnSeasonal adjusted estimates help eliminate sharp fluctuations
  in employment levels due to such seasonal events as changes in weather, reduced
  or expanded production, harvests, major holidays, and the opening and closing of
  schools. Adjusting the estimates to eliminate the seasonal events that tend to follow
  a regular pattern each year, make it easier to observe cyclical and other nonseasonal
  movements in the data. More information on the seasonal adjustment process can be
  found on the Bureau of Labor Statistics website: http://www.bls.gov/sae/790faq2.htm#Ques3.\",\n\t\"license_title\":
